import React from 'react';
import List from './List'

class Results extends React.PureComponent {

    constructor(props) {
        super(props)
    }   

    render() {
        const { data } = this.props;
        if (!data) {
            return "no results"
        }
        return (
            <div>
                {data.length > 0 ? <List results={data}/> : "no results"})
            </div>
        )
    }
}

export default Results;
